病院に連れて行った方がいいか否か院長に判断してもらって。
最悪入院かな。

判断が難しいよね。
もう少し病院が近ければ良いんだけど。
ギリギリ通える範囲にあるだけでもありがたいか。

父親の時もあと１日薬を強くしなければ白血病仲間に会えて意識持ったまま亡くなれた後悔もあるし。
自分の傍に朔玖は居て欲しいけど。
朔玖の命を優先にしなきゃ。
選べるのは私しかいないんだし。

